import {
  configureStore,
  createAsyncThunk,
  createSlice,
} from "@reduxjs/toolkit";
import axios from "axios";



let user = createSlice({
  name: "user",
  initialState: "you-eunkyung",
});

export default configureStore({
  reducer: {
    user: user.reducer,
  },
});
